import time
import calendar
from typing import Union

def parse_date_to_epoch(date_str: str) -> Union[int, None]:
    for format_string in ['%a %b %d %H:%M:%S %Y', '']:
        try:
            epoch = calendar.timegm(time.strptime(date_str, format_string))
            return epoch
        except ValueError:
            pass
    return None
